#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#include "util.h"

int test_strtoupper( char *in, char *out )
{
    char *test;
    printf( "   strtoupper( '%s', '%s') ", in, out );

    test = strtoupper( strdup( in ) );

    printf( " = '%s' ", test );

    if ( strlen( test ) == strlen( out ) ) {
        if ( strncmp( test, out, strlen(out) ) == 0 ) {
            printf( "passed\n" );
            free( test );
            return( 0 );
        }
    }
    printf( "failed\n" );
    free( test );
    return( 1 );
}

